import React from "react";
//Components
import LoginForm from '../components/LoginForm';

function Login( {LoginFunction} ) {
  return (
    <div>
      <p>Login</p>
      <LoginForm LoginFunction={LoginFunction} />
    </div>
  )
};

export default Login;
